import React from 'react';
import DefaultLayout from '../layouts/DefaultLayout.jsx';
import './_app.jsx';

const Home = () => {
    return (
        <DefaultLayout>
            <h2>
                Welcome to Mlo Art where you can buy a unique art piece. 
            </h2>
                <br/>
            <h2>
                No art piece is alike.
            </h2>
        </DefaultLayout>
    );
};

export default Home;
